        Data: `Alert: Attempted MFA Setup on Your Account`,
      },
      Body: {
        Html: {
          Charset: 'UTF-8',
          Data: generateMfaAlertTemplate(formattedDateTime, `${user.firstName} ${user.lastName}`),
        },
      },
    },
  };
  return await emailProvider.sendEmail(params);
}

